import React from 'react';

const Signin = () => {
    return (
        <article className="flex flex-wrap pv3 ph3 ba b--black-30 br2 w-50-m w-40-l shadow-4 center">
            <form className="measure w-100">
                <fieldset id="sign-up">
                    <legend className="white ph2">Sign In:</legend>
                    <div className="form-group flex flex-wrap mt2 w-100">
                        <label className="moon-gray f6 w-100">Email: </label>
                        <input className="mt2 w-100"
                            type="email"
                            name="email-address"
                            id="email" />
                    </div>
                </fieldset>
            </form>
        </article>
    );
}

export default Signin
